import styled from "styled-components";

const TodoGrid = styled.section`
    display: grid;
    width: 100%;
    grid-template-columns: repeat(3, 1fr);
    gap:10px;
`

const TodoBox = styled.div`
    display: flex;
    justify-content: center;
    border: 1px black solid;
    border-radius: 10px;
`

function Todo () {

    return (
        <TodoGrid>
            <TodoBox>
                <div> 나는 투두에오 </div>
            </TodoBox>
        </TodoGrid>
    )
}

export default Todo;
